import React from 'react';

function Skills() {
  return (
    <section className="section-image" id="skills">
      <div className="img-overlay"></div>
      <div className="intro">
        <h1>Skills</h1>
        <p>JavaScript, React, Node.js, Python, etc.</p>
      </div>
    </section>
  );
}

export default Skills;
